import React from 'react';
import s from './ModelPhoto.module.css';
import Slider from 'react-slick';
import mini from '../../images/price/modelPhotoSess/discountPrice/mini.png';
import middle from '../../images/price/modelPhotoSess/discountPrice/middle.png';
import max from '../../images/price/modelPhotoSess/discountPrice/max.png';
const ModelPhoto =()=>{
    let settings = {
        dots:false,
        infinite:true,
        slideToShow:1,
        slideToScroll:1,
        arrows:false,
        centerMode:true,
        centerPadding:'82px'
    };
    return(
        <div>
            <p>Модельные Фот</p>
<Slider {...settings}>
<div><img src={mini}></img></div>
<div><img src={middle}></img></div>
<div><img src={max}></img></div>
</Slider>
        </div> 
    );
};

export default ModelPhoto;
